import React from 'react';
import './InfoCard.css';

export const InfoCard = ({ title, data ,image}) => {
    return (
        <div className='info-card-container'>
            <div className='info-card-header'>
                <h2>{title}</h2>

            </div>
            <div className='user-config-img'>
                                <img src={image || '../img/isotipo-arsheep.png'} />
                            </div>
            <div className='info-card-body'>
                {Object.entries(data).map(([key, value]) => (
                    key !== 'title' && (
                        <div className='info-card-data-item' key={key}>
                            <div className='info-card-data-item-header' key={key}>
                                <p>{key} </p>
                            </div>
                            
                            <div className='info-card-data-item-body' key={key}>
                                <p>{value}</p>
                            </div>
                        </div>
                    )
                ))}

            </div >

        </div>
    );
}
